This fully furnished bedroom, with its own private bathroom, is a quiet, mellow place to retire after a hard day of work or play. Make yourself a meal in the fully equipped kitchen or read a book in front of the living room fireplace. Centrally located on the Westside, this apartment is close to entrances to the I-405 and I-10, allowing for quicker commutes to LAX, downtown L.A., San Fernando Valley, and South Bay. The room can comfortably accommodate up to 2 people. Animals are most welcome, and petsitting services are also available.
The room is currently available only from August 5-August 9. Short term stays during this period or stays for this entire period are welcome.
Daily Rate (minimum 3-night stay):
$70/weeknight
$75/weekend nights (Fri, Sat)
$25/day for a 2nd person
$25 cleaning fee. Inquire about fees for animals and petsitting.
Now, about the bedroom and bathroom:
*~11` x 14`, not including the closet;
*large closet (~2.25` x 8.5`) with sliding mirrored doors;
*ceiling fan;
*individual thermostat to heat just your room;
*direct sunlight in the afternoons from a window that looks out onto the street;
*additional closet space in the hallway if needed;
*amply sized private hallway bathroom (shower, no tub) that you`ll have all to yourself;
*fully furnished with a queen-size futon, dresser, bed sheets, towels, desk, and chairs. The room can be unfurnished too if needed.
About the apartment:
*2 bedroom/2 bathroom apartment (1150 sq. ft.);
*ground floor (1/2 flight of stairs up from street level);
*double-paned windows to keep street noise out;
*gas fireplace in the living room;
*gas stove/oven, dishwasher, full-sized refrigerator, granite counter tops in the kitchen;
*front patio;
*ceiling fan and A/C in the common area;
*radiant heating in ceilings throughout, with separate thermostats in each area of the apartment;
*surprisingly abundant, free street parking for this neighborhood, and parking can often be found directly in front of our building;
*street cleaning only 1 day a week (no parking permit needed and no other street parking restrictions are in effect);
*coin-operated laundry room in building.
About the location:
This apartment is located in Palms, a quiet, residential neighborhood of single-family homes and apartment buildings adjacent to Culver City, Mar Vista, and West LA. This area is centrally located on the Westside. The apartment itself is in walking distance to several stores and restaurants:
*0.3 miles (5-7 minute walk) to Trader Joe`s, Albertsons, Beard Papa`s, CVS, Alberstons, coffee shops and small restaurants;
*0.5 miles (10 minute walk) to numerous restaurants, cafes, bakeries, and stores on Venice Blvd.
Public transit options:
Despite LA`s reputation for poor public transit, various nearby public transit options exist.
*0.3 miles (5-7 minute walk) to the #6, #6 Rapid, and #12 buses on Sepulveda Blvd. which goes to UCLA and Westwood. The #6 and #6 Rapid also go to LAX Airport and the Culver City Mall.
*0.5 miles to the #33 bus on Venice Blvd., which operates 24/7, going to Santa Monica, Venice Beach, downtown Culver City, Culver City metro train station, Sony Studios, Union Station, and downtown L.A. The rapid #733 bus also travels along this route with limited stops.
*0.6 miles to the #3 bus which goes to Culver City Mall, West LA College, Westside Pavilion Mall, and Century City Shopping Center.
*2 miles (~8 minute drive) to Culver City Expo Line metro station, which provides faster access to USC, downtown L.A. and Union Station. The #33, #733, and #12 buses go to Culver City station, and free bike and car parking is available at the station.
Driving options:
The apartment is located a 3-5 minute drive to the I-405 and I-10 highway entrances, allowing for easier commutes into San Fernando Valley, Downtown L.A., and South Bay. Some typical driving times:
*8-minute drive to downtown Culver City
*15-minute drive to Venice Beach and Santa Monica Beach
*15-minute drive to UCLA and Westwood
*20-minute drive to LAX
*20-minute drive to North Hollywood
No indoor smoking allowed. Smoking on the patio is fine.
About us: We are a hetero (but queer-friendly!), artistically inclined, animal-loving couple in our 30s and 40s. We live in this shared apartment but have our own room and private bathroom. She works part of the time from home, so is often around to answer questions.
Craigslist has gotten quite spamalicious, so for more information or to inquire about specific dates, email some information about yourself:
1) What you`re doing in LA;
2) Why you`re looking for a short-term stay;
3) Links to any social media pages you have (Facebook, LinkedIn, AirBNB, etc.)
The more info the better since it helps us figure out if you`re pre-cooked canned meat product or not.
Enjoy your stay in Los Angeles!
